import { Fragment } from "react";
import styled from "styled-components";

export const list = styled.label`
  display: flex;
  flex-direction: row;
  align-items: center;
  padding: 8px 20px;
  gap: 15px;
`;
export const TodoText = styled.p`
  width: 229px;
  height: 24px;
  font-family: "Pretendard";
  font-style: normal;
  font-weight: 400;
  font-size: 16px;
  line-height: 24px;
  letter-spacing: -1px;
  color: #666666;
`;
export const Todo = () => {
  return (
    <Fragment>
      <li>
        <list>
          <input type={"radio"} />
          <TodoText>테스트 텍스트입니다</TodoText>
          <button>X</button>
        </list>
      </li>
    </Fragment>
  );
};
